import React from 'react'
import { getAllUser } from '../api/user'



const AllUsers = () => {
    const [users, setAllUsers] = useState<Array<User>>([])

    async function _getAllUsers() {
        const data = await getAllUser()
        setAllUsers(data)
    }

    useEffect( () => {
        _getAllUsers()
    },[])

}

export default AllUsers
